import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import api from "../api/axios";

export default function UserProfile() {
  const navigate = useNavigate();
  const user = JSON.parse(localStorage.getItem("user"));
  const [prescriptions, setPrescriptions] = useState([]);

  useEffect(() => {
    if (user?._id) {
      api.get(`/prescriptions/user/${user._id}`)
        .then(res => setPrescriptions(res.data))
        .catch(err => console.error("Failed to fetch prescriptions:", err));
    }
  }, [user]);

  if (!user) {
    return (
      <div className="container my-5">
        <div className="alert alert-danger text-center">
          User not logged in.
        </div>
      </div>
    );
  }

  return (
    <div className="container my-5">
      <div className="row">
        {/* Sidebar */}
        <div className="col-md-3 mb-4 mb-md-0">
          <div className="list-group shadow-sm">
            <button className="list-group-item list-group-item-action active">
              ðŸ‘¤ My Profile
            </button>
            <button
              className="list-group-item list-group-item-action"
              onClick={() => navigate("/orders")}
            >
              ðŸ“¦ Orders
            </button>
            <button
              className="list-group-item list-group-item-action"
              onClick={() => navigate("/prescriptions")}
            >
              ðŸ§¾ Prescription Status
            </button>
            <button
              className="list-group-item list-group-item-action text-danger"
              onClick={() => {
                localStorage.removeItem("user");
                navigate("/login");
              }}
            >
              ðŸ”“ Logout
            </button>
          </div>
        </div>

        {/* Main Content */}
        <div className="col-md-9">
          {/* Profile Info */}
          <div className="card p-4 shadow-sm mb-4">
            <h3 className="text-success mb-3">ðŸ‘¤ User Profile</h3>
            <p><strong>Name:</strong> {user.name}</p>
            <p><strong>Email:</strong> {user.email}</p>
            <p><strong>Role:</strong> {user.role}</p>
          </div>

          {/* Prescription Status */}
          <div>
            <h4 className="mb-4 text-primary">ðŸ§¾ Approved Prescriptions</h4>
            {prescriptions.length === 0 ? (
              <div className="alert alert-info">No approved prescriptions found.</div>
            ) : (
              prescriptions.map(p => (
                <div key={p._id} className="card mb-4 p-3 shadow-sm">
                  <h5 className="text-success">Prescription #{p._id.slice(-6)}</h5>
                  <p><strong>Approved At:</strong> {new Date(p.updatedAt).toLocaleString()}</p>
                  <ul className="list-group mb-3">
                    {p.medicineIds.map(med => (
                      <li key={med._id} className="list-group-item d-flex justify-content-between align-items-center">
                        <div>
                          <strong>{med.name}</strong> â€“ â‚¹{med.price}
                          <br />
                          <small>{med.description}</small>
                        </div>
                        <button
                          className="btn btn-sm btn-outline-primary"
                          onClick={() => navigate(`/buy/${med._id}`)}
                        >
                          Buy
                        </button>
                      </li>
                    ))}
                  </ul>
                  <button
                    className="btn btn-success w-100"
                    onClick={() => navigate(`/checkout?prescription=${p._id}`)}
                  >
                    ðŸ›’ Buy All Medicines
                  </button>
                </div>
              ))
            )}
          </div>
        </div>
      </div>
    </div>
  );
}
